【ボタリッチ 生酵素×スーパーフルーツ スムージーの詳細】<br>
●伝統の3年熟成酵素含む「339種類の植物発酵エキス」をベースに、美容に役立つ「10種類のスーパーフルーツ」を配合しました。<br>
●ビタミン、コラーゲンなどもたっぷり配合し、毎日のダイエットビューティーをサポートします。<br>
●10種のスーパーフルーツ：アサイー・マキベリー・ピタヤ・アセロラ・ザクロ・ブルーベリー・ブラックカラント・レッドラズベリー・アロニア・リンゴベリー<br><br>

【お召し上がり方】<br>
1回20g（大スプーン2杯）を目安に約200mlのお水などに溶かしてお召し上がりください。お好みによりお水の量は加減してください。牛乳やヨーグルトでもお勧めです。<br><br>
【ご注意】<br>
○健康的なダイエットは栄養バランスのとれた食事と適度な運動が必要です。<br>
○原材料をご参照の上、食品アレルギーがある方はお召し上がりにならないでください。<br>
○妊娠・授乳中の方、疾病治療中の方は医師に相談のうえ、お召し上がりください。<br>○お召し上がり後体調のすぐれない場合は直ちに召し上がるのを中止なさってください。<br>
○開封後は、必ずしっかり封をして3週間を目安にお早めに使い切るようにしてください。<br>
○ぬれたスプーンでのご使用は、粉末の色が変わる場合がありますのでお控えください。<br>
○本品は、植物由来の原料を使用しておりますので色調などにバラツキがある場合がありますが、品質に問題ありません。<br>
○粉末のまま直接口に入れると、のどに詰まる危険がありますのでお控えください。<br>○高温多湿を避け、冷暗所で保管してください。<br><br>

【原材料名】<br>
水溶性食物繊維、ブドウ糖、クリーミングパウダー、アサイー果汁パウダー、バナナパウダー、野菜ミックスパウダー、コラーゲンペプチド、りんご果汁末、レモン果汁末、グレープ果汁末、麦芽エキス末、グルコマンナン、マキベリー果汁パウダー、レッドドラゴンフルーツエキス末、ザクロ果汁パウダー、アセロラ末、穀物発酵エキス末、植物発酵エキス末(コーンスターチ、デキストリン、植物発酵エキス)、植物発酵物乾燥粉末(植物発酵エキス(黒砂糖、キャベツ、他)マルトデキストリン)、植物発酵抽出物、植物エキス発酵液末(デキストリン、植物エキス発酵液)、ベリーミックスパウダー、乳酸菌末(殺菌)、難消化性デキストリン、乳酸菌凍結乾燥粉末、酸味料、増粘多糖類、ブドウ果皮色素、野菜色素、甘味料(ステビア、アセスルファムK、スクラロース)、V.C、乳化剤、ピロリン酸鉄、香料、ナイアシン、V.E、パントテン酸Ca、V.B1、V.B6、V.A、V.B2、葉酸、V.D、V.B12、(原材料の一部に、小麦、乳、ゼラチン、バナナ、リンゴ、やまいも、オレンジ、キウイフルーツ、カシューナッツ、ゴマ、大豆、ももを含む)<br><br>

【栄養成分表示】1杯20gあたり<br>
エネルギー：59.2kcal、たんぱく質：0.28g、脂質：0.16g、糖質：9.66g、食物繊維：9g、ナトリウム：124.2mg、ビタミンA：75μg、ビタミンD：0.83μg、ビタミンE：1.33mg、ビタミンB1：0.17mg、ビタミンB2：0.18mg、ビタミンB6:0.17mg、ナイアシン：1.83mg、パントテン酸：0.92mg、ビタミンB12：0.33μg、葉酸：33μg、ビタミンC13mg<br><br>

【賞味期限】<br>
パッケージに記載<br><br>

【内容量】<br>
200g<br><br>

【販売元】<br>
ジェイピーエスラボ株式会社<br>
東京都港区北青山3-5-17<br>
お問い合わせ先：03-6804-5399<br><br>

【商品区分】<br>
栄養補助食品<br><br>

[食物繊維、植物発酵エキス加工食品] 

<br><br><br><hr>
広告文責：株式会社モリキ<br>
